[a, fs] = audioread('Chord.wav');
x = a(:,1);
x = x(:);                             
Delta_tau = 1/fs;
dt   = 0.01;
df   = 1;
sgm  = 200;
tmax = (length(x)-1)*Delta_tau;
t    = 0:dt:tmax;
f    = 20:df:1000;
%run
tic
[Y, tgrid, fgrid] = gabor_scaled_unbalanced(x, Delta_tau, t, f, sgm);
elapsed = toc;
fprintf('Running time: %.4f s\n', elapsed); %[output:80efebd1]

% time-freq plot
figure('Color','w'); %[output:1ffd8a13]
imagesc(tgrid, fgrid, abs(Y.').'); %[output:1ffd8a13]
colormap(gray(256)); %[output:1ffd8a13]
set(gca,'YDir','normal'); axis tight %[output:1ffd8a13]
xlabel('t (s)'); ylabel('f (Hz)'); %[output:1ffd8a13]
title(sprintf('Scaled Gabor transform')); %[output:1ffd8a13]
colorbar %[output:1ffd8a13]

function [Y, tgrid, fgrid] = gabor_scaled_unbalanced(x, Delta_tau, tgrid, fgrid, sigma)
    %   G_x(t,f) = (sigma)^(1/4) ∫ e^{-σπ(τ-t)^2} e^{-j2π f τ} x(τ) dτ
    x = x(:);
    L = length(x);
    % finite interval：|tau - t| <= B, B ≈ 1.9143 / sqrt(σ)
    B = 1.9143 / sqrt(sigma);
    Q = ceil(B / Delta_tau);
    Dt = tgrid(2) - tgrid(1);
    Df = fgrid(2) - fgrid(1);
    S  = round(Dt / Delta_tau);
    Dt = S * Delta_tau;
    tgrid = tgrid(1) + (0:length(tgrid)-1) * Dt;
    
    % Δf·Δτ = 1/N  →  N0 = round(1/(Δf·Δτ))
    N0 = round(1/(Df * Delta_tau));
    N  = max(N0, 2*Q + 1);
    N  = 2^nextpow2(N);
    Df_eff = 1 / (N * Delta_tau);%real freq resolution
    
    m_idx = round(fgrid / Df_eff);           % m = round(f / (1/(NΔτ))) = round(f*N*Δτ)
    % Gaussian
    k = (-Q:Q).';
    w = sigma^(1/4) * exp(-sigma*pi*(k*Delta_tau).^2);%Scaled Gabor window
    
    C = numel(tgrid);
    F = numel(fgrid);
    Y = complex(zeros(F, C));
    
    for n = 1:C
        %（τ = t = nSΔτ
        nS = (n-1)*S;
        center = nS + 1;
        idx = center + k;                     
        mask = (idx >= 1) & (idx <= L);
        seg = zeros(size(k));
        seg(mask) = x(idx(mask));
        x1 = zeros(N,1);
        x1(1:numel(k)) = w .* seg;
        % FFT
        X1 = fft(x1, N);
    
        %X(nΔt, mΔf) ：Δτ * e^{j2π (Q - nS) m / N} * X1(m)
        phase = exp( 1j*2*pi * (Q - nS) * (m_idx(:).') / N );
        Y(:, n) = (Delta_tau) * (phase.' .* X1(m_idx+1));
    end
end

